package main

import "fmt"

func main() {
	fmt.Println("Part 1:", FindTreesPartOne(input, 3, 1))
	fmt.Println("Part 2:", FindTreesPartTwo(input))
}

func FindTreesPartOne(ma [][]byte, right, down int) int {
	var x, y int

	width := len(ma[0])
	height := len(ma)

	var trees int

	for {
		x += right
		y += down

		if x >= width {
			x = x - width
		}

		if y >= height {
			break
		}

		if ma[y][x] == '.' {
			continue
		}

		trees++
	}

	return trees
}

func FindTreesPartTwo(ma [][]byte) int {
	a := FindTreesPartOne(ma, 3, 1)
	b := FindTreesPartOne(ma, 1, 1)
	c := FindTreesPartOne(ma, 5, 1)
	d := FindTreesPartOne(ma, 7, 1)
	e := FindTreesPartOne(ma, 1, 2)
	return a * b * c * d * e
}

